import React from "react";
import { Carousel } from "react-bootstrap";
import './Carousel.css';

import SWIFT from '../src/images/SWIFT.jpg';
import XE from '../src/images/XE.jpg';
import SLAVIA from '../src/images/SLAVIA.jpg';

const CarouselIMG =()=>{
    return(
        <>
        <Carousel fade>
  <Carousel.Item>
    <img
      className="d-block w-50 mx-auto"
      src={SWIFT}
      alt="First slide"
    />
    <Carousel.Caption>
      <h3>First slide label</h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-50 mx-auto"
      src={SLAVIA}
      alt="Second slide"
    />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-50 mx-auto"
      src={XE}
      alt="Third slide"
    />

    <Carousel.Caption>
      <h3>Third slide label</h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>
        </>
        );
};

export default CarouselIMG;
